#!/usr/bin/env python3
"""CLI interface for claude-code-log."""

import logging
import os
import sys
from pathlib import Path
from typing import Optional, List

import click

from .converter import convert_jsonl_to_html, process_projects_hierarchy
from .cache import CacheManager, get_library_version


def _launch_tui_with_cache_check(project_path: Path) -> Optional[str]:
    """Launch TUI with proper cache checking and user feedback."""
    click.echo("Checking cache and loading session data...")

    # Check if we need to rebuild cache
    cache_manager = CacheManager(project_path, get_library_version())
    jsonl_files = list(project_path.glob("*.jsonl"))
    modified_files = cache_manager.get_modified_files(jsonl_files)
    project_cache = cache_manager.get_cached_project_data()

    if not (project_cache and project_cache.sessions and not modified_files):
        # Need to rebuild cache
        if modified_files:
            click.echo(
                f"Found {len(modified_files)} modified files, rebuilding cache..."
            )
        else:
            click.echo("Building session cache...")

        # Pre-build the cache before launching TUI
        try:
            convert_jsonl_to_html(project_path, silent=True)
            click.echo("Cache ready! Launching TUI...")
        except Exception as e:
            click.echo(f"Error building cache: {e}", err=True)
            return
    else:
        click.echo(
            f"Cache up to date. Found {len(project_cache.sessions)} sessions. Launching TUI..."
        )

    # Small delay to let user see the message before TUI clears screen
    import time

    time.sleep(0.5)

    from .tui import run_session_browser

    result = run_session_browser(project_path)
    return result


def convert_project_path_to_claude_dir(input_path: Path) -> Path:
    """Convert a project path to the corresponding directory in ~/.claude/projects/."""
    # Get the real path to resolve any symlinks
    real_path = input_path.resolve()

    # Convert the path to the expected format: replace slashes with hyphens
    path_parts = real_path.parts
    if path_parts[0] == "/":
        path_parts = path_parts[1:]  # Remove leading slash

    # Join with hyphens instead of slashes, prepend with dash
    claude_project_name = "-" + "-".join(path_parts)

    # Construct the path in ~/.claude/projects/
    claude_projects_dir = Path.home() / ".claude" / "projects" / claude_project_name

    return claude_projects_dir


def find_projects_by_cwd(
    projects_dir: Path, current_cwd: Optional[str] = None
) -> List[Path]:
    """Find Claude projects that match the current working directory."""
    if current_cwd is None:
        current_cwd = os.getcwd()

    # Normalize the current working directory
    current_cwd_path = Path(current_cwd).resolve()

    matching_projects: List[Path] = []

    # Check all project directories
    if not projects_dir.exists():
        return matching_projects

    for project_dir in projects_dir.iterdir():
        if not project_dir.is_dir() or not list(project_dir.glob("*.jsonl")):
            continue

        try:
            # Load cache to check for working directories
            cache_manager = CacheManager(project_dir, get_library_version())
            project_cache = cache_manager.get_cached_project_data()

            # Check if we need to build cache (empty cache or no working directories)
            if not project_cache or not project_cache.working_directories:
                # Check if we have any JSONL files to process
                jsonl_files = list(project_dir.glob("*.jsonl"))
                if jsonl_files:
                    # Build cache by processing the project
                    try:
                        convert_jsonl_to_html(project_dir, silent=True)
                        # Reload cache after building
                        project_cache = cache_manager.get_cached_project_data()
                    except Exception as e:
                        logging.warning(
                            f"Failed to build cache for project {project_dir.name}: {e}"
                        )
                        # If cache building fails, fall back to path name matching
                        project_cache = None

            if project_cache and project_cache.working_directories:
                # Check if current cwd matches any working directory in this project
                for cwd in project_cache.working_directories:
                    cwd_path = Path(cwd).resolve()
                    # Check for exact match or if current cwd is under this path
                    if current_cwd_path == cwd_path or current_cwd_path.is_relative_to(
                        cwd_path
                    ):
                        matching_projects.append(project_dir)
                        break
            else:
                # Fall back to path name matching if no cache data
                project_name = project_dir.name
                if project_name.startswith("-"):
                    # Convert Claude project name back to path
                    path_parts = project_name[1:].split("-")
                    if path_parts:
                        reconstructed_path = Path("/") / Path(*path_parts)
                        if (
                            current_cwd_path == reconstructed_path
                            or current_cwd_path.is_relative_to(reconstructed_path)
                            or reconstructed_path.is_relative_to(current_cwd_path)
                        ):
                            matching_projects.append(project_dir)
        except Exception:
            # Skip projects with cache issues
            continue

    return matching_projects


def _clear_caches(input_path: Path, all_projects: bool) -> None:
    """Clear cache directories for the specified path."""
    try:
        library_version = get_library_version()

        if all_projects:
            # Clear cache for all project directories
            click.echo("Clearing caches for all projects...")
            project_dirs = [
                d
                for d in input_path.iterdir()
                if d.is_dir() and list(d.glob("*.jsonl"))
            ]

            for project_dir in project_dirs:
                try:
                    cache_manager = CacheManager(project_dir, library_version)
                    cache_manager.clear_cache()
                    click.echo(f"  Cleared cache for {project_dir.name}")
                except Exception as e:
                    click.echo(
                        f"  Warning: Failed to clear cache for {project_dir.name}: {e}"
                    )

        elif input_path.is_dir():
            # Clear cache for single directory
            click.echo(f"Clearing cache for {input_path}...")
            cache_manager = CacheManager(input_path, library_version)
            cache_manager.clear_cache()
        else:
            # Single file - no cache to clear
            click.echo("Cache clearing not applicable for single files.")

    except Exception as e:
        click.echo(f"Warning: Failed to clear cache: {e}")


def _clear_html_files(input_path: Path, all_projects: bool) -> None:
    """Clear HTML files for the specified path."""
    try:
        if all_projects:
            # Clear HTML files for all project directories
            click.echo("Clearing HTML files for all projects...")
            project_dirs = [
                d
                for d in input_path.iterdir()
                if d.is_dir() and list(d.glob("*.jsonl"))
            ]

            total_removed = 0
            for project_dir in project_dirs:
                try:
                    # Remove HTML files in project directory
                    html_files = list(project_dir.glob("*.html"))
                    for html_file in html_files:
                        html_file.unlink()
                        total_removed += 1

                    if html_files:
                        click.echo(
                            f"  Removed {len(html_files)} HTML files from {project_dir.name}"
                        )
                except Exception as e:
                    click.echo(
                        f"  Warning: Failed to clear HTML files for {project_dir.name}: {e}"
                    )

            # Also remove top-level index.html
            index_file = input_path / "index.html"
            if index_file.exists():
                index_file.unlink()
                total_removed += 1
                click.echo("  Removed top-level index.html")

            if total_removed > 0:
                click.echo(f"Total: Removed {total_removed} HTML files")
            else:
                click.echo("No HTML files found to remove")

        elif input_path.is_dir():
            # Clear HTML files for single directory
            click.echo(f"Clearing HTML files for {input_path}...")
            html_files = list(input_path.glob("*.html"))
            for html_file in html_files:
                html_file.unlink()

            if html_files:
                click.echo(f"Removed {len(html_files)} HTML files")
            else:
                click.echo("No HTML files found to remove")
        else:
            # Single file - remove corresponding HTML file
            html_file = input_path.with_suffix(".html")
            if html_file.exists():
                html_file.unlink()
                click.echo(f"Removed {html_file}")
            else:
                click.echo("No corresponding HTML file found to remove")

    except Exception as e:
        click.echo(f"Warning: Failed to clear HTML files: {e}")


@click.command()
@click.argument("input_path", type=click.Path(path_type=Path), required=False)
@click.option(
    "-o",
    "--output",
    type=click.Path(path_type=Path),
    help="Output HTML file path (default: input file with .html extension or combined_transcripts.html for directories)",
)
@click.option(
    "--open-browser",
    is_flag=True,
    help="Open the generated HTML file in the default browser",
)
@click.option(
    "--from-date",
    type=str,
    help='Filter messages from this date/time (e.g., "2 hours ago", "yesterday", "2025-06-08")',
)
@click.option(
    "--to-date",
    type=str,
    help='Filter messages up to this date/time (e.g., "1 hour ago", "today", "2025-06-08 15:00")',
)
@click.option(
    "--all-projects",
    is_flag=True,
    help="Process all projects in ~/.claude/projects/ hierarchy and create linked HTML files",
)
@click.option(
    "--no-individual-sessions",
    is_flag=True,
    help="Skip generating individual session HTML files (only create combined transcript)",
)
@click.option(
    "--no-cache",
    is_flag=True,
    help="Disable caching and force reprocessing of all files",
)
@click.option(
    "--clear-cache",
    is_flag=True,
    help="Clear all cache directories before processing",
)
@click.option(
    "--clear-html",
    is_flag=True,
    help="Clear all HTML files and force regeneration",
)
@click.option(
    "--tui",
    is_flag=True,
    help="Launch interactive TUI for session browsing and management",
)
def main(
    input_path: Optional[Path],
    output: Optional[Path],
    open_browser: bool,
    from_date: Optional[str],
    to_date: Optional[str],
    all_projects: bool,
    no_individual_sessions: bool,
    no_cache: bool,
    clear_cache: bool,
    clear_html: bool,
    tui: bool,
) -> None:
    """Convert Claude transcript JSONL files to HTML.

    INPUT_PATH: Path to a Claude transcript JSONL file, directory containing JSONL files, or project path to convert. If not provided, defaults to ~/.claude/projects/ and --all-projects is used.
    """
    # Configure logging to show warnings and above
    logging.basicConfig(level=logging.WARNING, format="%(levelname)s: %(message)s")

    try:
        # Handle TUI mode
        if tui:
            # Handle default case for TUI - use ~/.claude/projects if no input path
            if input_path is None:
                input_path = Path.home() / ".claude" / "projects"

            # If targeting all projects, show project selection TUI
            if (
                all_projects
                or not input_path.exists()
                or not list(input_path.glob("*.jsonl"))
            ):
                # Show project selection interface
                if not input_path.exists():
                    click.echo(f"Error: Projects directory not found: {input_path}")
                    return

                project_dirs = [
                    d
                    for d in input_path.iterdir()
                    if d.is_dir() and list(d.glob("*.jsonl"))
                ]

                if not project_dirs:
                    click.echo(f"No projects with JSONL files found in {input_path}")
                    return

                # Try to find projects that match current working directory
                matching_projects = find_projects_by_cwd(input_path)

                if len(project_dirs) == 1:
                    # Only one project, open it directly
                    result = _launch_tui_with_cache_check(project_dirs[0])
                    if result == "back_to_projects":
                        # User wants to see project selector even though there's only one project
                        from .tui import run_project_selector

                        while True:
                            selected_project = run_project_selector(
                                project_dirs, matching_projects
                            )
                            if not selected_project:
                                # User cancelled
                                return

                            result = _launch_tui_with_cache_check(selected_project)
                            if result != "back_to_projects":
                                # User quit normally
                                return
                    return
                elif matching_projects and len(matching_projects) == 1:
                    # Found exactly one project matching current working directory
                    click.echo(
                        f"Found project matching current directory: {matching_projects[0].name}"
                    )
                    result = _launch_tui_with_cache_check(matching_projects[0])
                    if result == "back_to_projects":
                        # User wants to see project selector
                        from .tui import run_project_selector

                        while True:
                            selected_project = run_project_selector(
                                project_dirs, matching_projects
                            )
                            if not selected_project:
                                # User cancelled
                                return

                            result = _launch_tui_with_cache_check(selected_project)
                            if result != "back_to_projects":
                                # User quit normally
                                return
                    return
                else:
                    # Multiple projects or multiple matching projects - show selector
                    from .tui import run_project_selector

                    while True:
                        selected_project = run_project_selector(
                            project_dirs, matching_projects
                        )
                        if not selected_project:
                            # User cancelled
                            return

                        result = _launch_tui_with_cache_check(selected_project)
                        if result != "back_to_projects":
                            # User quit normally
                            return
            else:
                # Single project directory
                _launch_tui_with_cache_check(input_path)
                return

        # Handle default case - process all projects hierarchy if no input path and --all-projects flag
        if input_path is None:
            input_path = Path.home() / ".claude" / "projects"
            all_projects = True

        # Handle cache clearing
        if clear_cache:
            _clear_caches(input_path, all_projects)
            if clear_cache and not (from_date or to_date or input_path.is_file()):
                # If only clearing cache, exit after clearing
                click.echo("Cache cleared successfully.")
                return

        # Handle HTML files clearing
        if clear_html:
            _clear_html_files(input_path, all_projects)
            if clear_html and not (from_date or to_date or input_path.is_file()):
                # If only clearing HTML files, exit after clearing
                click.echo("HTML files cleared successfully.")
                return

        # Handle --all-projects flag or default behavior
        if all_projects:
            if not input_path.exists():
                raise FileNotFoundError(f"Projects directory not found: {input_path}")

            click.echo(f"Processing all projects in {input_path}...")
            output_path = process_projects_hierarchy(
                input_path, from_date, to_date, not no_cache
            )

            # Count processed projects
            project_count = len(
                [
                    d
                    for d in input_path.iterdir()
                    if d.is_dir() and list(d.glob("*.jsonl"))
                ]
            )
            click.echo(
                f"Successfully processed {project_count} projects and created index at {output_path}"
            )

            if open_browser:
                click.launch(str(output_path))
            return

        # Original single file/directory processing logic
        should_convert = False

        if not input_path.exists():
            # Path doesn't exist, try conversion
            should_convert = True
        elif input_path.is_dir():
            # Path exists and is a directory, check if it has JSONL files
            jsonl_files = list(input_path.glob("*.jsonl"))
            if len(jsonl_files) == 0:
                # No JSONL files found, try conversion
                should_convert = True

        if should_convert:
            claude_path = convert_project_path_to_claude_dir(input_path)
            if claude_path.exists():
                click.echo(f"Converting project path {input_path} to {claude_path}")
                input_path = claude_path
            elif not input_path.exists():
                # Original path doesn't exist and conversion failed
                raise FileNotFoundError(
                    f"Neither {input_path} nor {claude_path} exists"
                )

        output_path = convert_jsonl_to_html(
            input_path,
            output,
            from_date,
            to_date,
            not no_individual_sessions,
            not no_cache,
        )
        if input_path.is_file():
            click.echo(f"Successfully converted {input_path} to {output_path}")
        else:
            jsonl_count = len(list(input_path.glob("*.jsonl")))
            if not no_individual_sessions:
                session_files = list(input_path.glob("session-*.html"))
                click.echo(
                    f"Successfully combined {jsonl_count} transcript files from {input_path} to {output_path} and generated {len(session_files)} individual session files"
                )
            else:
                click.echo(
                    f"Successfully combined {jsonl_count} transcript files from {input_path} to {output_path}"
                )

        if open_browser:
            click.launch(str(output_path))

    except FileNotFoundError as e:
        click.echo(f"Error: {e}", err=True)
        sys.exit(1)
    except Exception as e:
        click.echo(f"Error converting file: {e}", err=True)
        sys.exit(1)


if __name__ == "__main__":
    main()

#!/usr/bin/env python3
"""Convert Claude transcript JSONL files to HTML."""

from pathlib import Path
import traceback
from typing import List, Optional, Dict, Any, TYPE_CHECKING

if TYPE_CHECKING:
    from .cache import CacheManager

from .utils import (
    should_use_as_session_starter,
    create_session_preview,
    extract_working_directories,
    map_summaries_to_sessions,
    aggregate_token_usage,
)
from .cache import CacheManager, SessionCacheData, get_library_version
from .parser import (
    load_transcript,
    load_directory_transcripts,
    filter_messages_by_date,
)
from .models import (
    TranscriptEntry,
    SummaryTranscriptEntry,
    UserTranscriptEntry,
)
from .html_generator import (
    generate_html,
    generate_session_html,
    generate_projects_index_html,
    is_html_outdated,
    get_project_display_name,
)


def convert_jsonl_to_html(
    input_path: Path,
    output_path: Optional[Path] = None,
    from_date: Optional[str] = None,
    to_date: Optional[str] = None,
    generate_individual_sessions: bool = True,
    use_cache: bool = True,
    silent: bool = False,
) -> Path:
    """Convert JSONL transcript(s) to HTML file(s)."""
    if not input_path.exists():
        raise FileNotFoundError(f"Input path not found: {input_path}")

    # Initialize cache manager for directory mode
    cache_manager = None
    if use_cache and input_path.is_dir():
        try:
            library_version = get_library_version()
            cache_manager = CacheManager(input_path, library_version)
        except Exception as e:
            print(f"Warning: Failed to initialize cache manager: {e}")

    if input_path.is_file():
        # Single file mode - cache only available for directory mode
        if output_path is None:
            output_path = input_path.with_suffix(".html")
        messages = load_transcript(input_path, silent=silent)
        title = f"Claude Transcript - {input_path.stem}"
    else:
        # Directory mode - Cache-First Approach
        if output_path is None:
            output_path = input_path / "combined_transcripts.html"

        # Phase 1: Ensure cache is fresh and populated
        ensure_fresh_cache(input_path, cache_manager, from_date, to_date, silent)

        # Phase 2: Load messages (will use fresh cache when available)
        messages = load_directory_transcripts(
            input_path, cache_manager, from_date, to_date, silent
        )

        # Extract working directories directly from parsed messages
        working_directories = extract_working_directories(messages)

        project_title = get_project_display_name(input_path.name, working_directories)
        title = f"Claude Transcripts - {project_title}"

    # Apply date filtering
    messages = filter_messages_by_date(messages, from_date, to_date)

    # Update title to include date range if specified
    if from_date or to_date:
        date_range_parts: List[str] = []
        if from_date:
            date_range_parts.append(f"from {from_date}")
        if to_date:
            date_range_parts.append(f"to {to_date}")
        date_range_str = " ".join(date_range_parts)
        title += f" ({date_range_str})"

    # Generate combined HTML file (check if regeneration needed)
    assert output_path is not None
    should_regenerate = (
        is_html_outdated(output_path)
        or from_date is not None
        or to_date is not None
        or not output_path.exists()
    )

    if should_regenerate:
        html_content = generate_html(messages, title)
        output_path.write_text(html_content, encoding="utf-8")
    else:
        print(f"HTML file {output_path.name} is current, skipping regeneration")

    # Generate individual session files if requested and in directory mode
    if generate_individual_sessions and input_path.is_dir():
        _generate_individual_session_files(
            messages, input_path, from_date, to_date, cache_manager
        )

    return output_path


def ensure_fresh_cache(
    project_dir: Path,
    cache_manager: Optional[CacheManager],
    from_date: Optional[str] = None,
    to_date: Optional[str] = None,
    silent: bool = False,
) -> bool:
    """Ensure cache is fresh and populated. Returns True if cache was updated."""
    if cache_manager is None:
        return False

    # Check if cache needs updating
    jsonl_files = list(project_dir.glob("*.jsonl"))
    if not jsonl_files:
        return False

    # Get cached project data
    cached_project_data = cache_manager.get_cached_project_data()

    # Check various invalidation conditions
    needs_update = (
        cached_project_data is None
        or from_date is not None
        or to_date is not None
        or cache_manager.get_modified_files(jsonl_files)  # Files changed
        or (cached_project_data.total_message_count == 0 and jsonl_files)  # Stale cache
    )

    if not needs_update:
        return False  # Cache is already fresh

    # Load and process messages to populate cache
    print(f"Updating cache for {project_dir.name}...")
    messages = load_directory_transcripts(
        project_dir, cache_manager, from_date, to_date, silent
    )

    # Update cache with fresh data
    _update_cache_with_session_data(cache_manager, messages)
    return True


def _update_cache_with_session_data(
    cache_manager: CacheManager, messages: List[TranscriptEntry]
) -> None:
    """Update cache with session and project aggregate data."""
    from .parser import extract_text_content

    # Collect session data using shared utility
    session_summaries, _ = map_summaries_to_sessions(messages)

    # Group messages by session and calculate session data
    sessions_cache_data: Dict[str, SessionCacheData] = {}

    # Track token usage and timestamps for project aggregates
    total_input_tokens = 0
    total_output_tokens = 0
    total_cache_creation_tokens = 0
    total_cache_read_tokens = 0
    total_message_count = len(messages)
    earliest_timestamp = ""
    latest_timestamp = ""
    seen_request_ids: set[str] = set()

    for message in messages:
        # Update project-level timestamp tracking
        if hasattr(message, "timestamp"):
            message_timestamp = getattr(message, "timestamp", "")
            if message_timestamp:
                if not latest_timestamp or message_timestamp > latest_timestamp:
                    latest_timestamp = message_timestamp
                if not earliest_timestamp or message_timestamp < earliest_timestamp:
                    earliest_timestamp = message_timestamp

        # Process session-level data (skip summaries)
        if hasattr(message, "sessionId") and not isinstance(
            message, SummaryTranscriptEntry
        ):
            session_id = getattr(message, "sessionId", "")
            if not session_id:
                continue

            if session_id not in sessions_cache_data:
                sessions_cache_data[session_id] = SessionCacheData(
                    session_id=session_id,
                    summary=session_summaries.get(session_id),
                    first_timestamp=getattr(message, "timestamp", ""),
                    last_timestamp=getattr(message, "timestamp", ""),
                    message_count=0,
                    first_user_message="",
                    cwd=getattr(message, "cwd", None),
                )

            session_cache = sessions_cache_data[session_id]
            session_cache.message_count += 1
            current_timestamp = getattr(message, "timestamp", "")
            if current_timestamp:
                session_cache.last_timestamp = current_timestamp

            # Get first user message for preview
            if (
                isinstance(message, UserTranscriptEntry)
                and not session_cache.first_user_message
                and hasattr(message, "message")
            ):
                first_user_content = extract_text_content(message.message.content)
                if should_use_as_session_starter(first_user_content):
                    session_cache.first_user_message = create_session_preview(
                        first_user_content
                    )

        # Calculate token usage for assistant messages
        if message.type == "assistant" and hasattr(message, "message"):
            assistant_message = getattr(message, "message")
            request_id = getattr(message, "requestId", None)
            session_id = getattr(message, "sessionId", "")

            if (
                hasattr(assistant_message, "usage")
                and assistant_message.usage
                and request_id
                and request_id not in seen_request_ids
            ):
                seen_request_ids.add(request_id)
                usage = assistant_message.usage

                # Add to project totals
                project_totals = {
                    "input": total_input_tokens,
                    "output": total_output_tokens,
                    "cache_creation": total_cache_creation_tokens,
                    "cache_read": total_cache_read_tokens,
                }
                aggregate_token_usage(usage, project_totals)
                total_input_tokens = project_totals["input"]
                total_output_tokens = project_totals["output"]
                total_cache_creation_tokens = project_totals["cache_creation"]
                total_cache_read_tokens = project_totals["cache_read"]

                # Add to session totals
                if session_id in sessions_cache_data:
                    session_cache = sessions_cache_data[session_id]
                    session_totals = {
                        "input": session_cache.total_input_tokens,
                        "output": session_cache.total_output_tokens,
                        "cache_creation": session_cache.total_cache_creation_tokens,
                        "cache_read": session_cache.total_cache_read_tokens,
                    }
                    aggregate_token_usage(usage, session_totals)
                    session_cache.total_input_tokens = session_totals["input"]
                    session_cache.total_output_tokens = session_totals["output"]
                    session_cache.total_cache_creation_tokens = session_totals[
                        "cache_creation"
                    ]
                    session_cache.total_cache_read_tokens = session_totals["cache_read"]

    # Update cache with session data
    cache_manager.update_session_cache(sessions_cache_data)

    # Update cache with working directories
    cache_manager.update_working_directories(
        extract_working_directories(list(sessions_cache_data.values()))
    )

    # Update cache with project aggregates
    cache_manager.update_project_aggregates(
        total_message_count=total_message_count,
        total_input_tokens=total_input_tokens,
        total_output_tokens=total_output_tokens,
        total_cache_creation_tokens=total_cache_creation_tokens,
        total_cache_read_tokens=total_cache_read_tokens,
        earliest_timestamp=earliest_timestamp,
        latest_timestamp=latest_timestamp,
    )


def _format_session_timestamp_range(first_timestamp: str, last_timestamp: str) -> str:
    """Format session timestamp range for display."""
    from .template_data import format_timestamp

    if first_timestamp and last_timestamp:
        if first_timestamp == last_timestamp:
            return format_timestamp(first_timestamp)
        else:
            return f"{format_timestamp(first_timestamp)} - {format_timestamp(last_timestamp)}"
    elif first_timestamp:
        return format_timestamp(first_timestamp)
    else:
        return ""


def _collect_project_sessions(messages: List[TranscriptEntry]) -> List[Dict[str, Any]]:
    """Collect session data for project index navigation."""
    from .parser import extract_text_content

    # Pre-process to find and attach session summaries
    # Use shared utility to map summaries to sessions
    session_summaries, _ = map_summaries_to_sessions(messages)

    # Group messages by session
    sessions: Dict[str, Dict[str, Any]] = {}
    for message in messages:
        if hasattr(message, "sessionId") and not isinstance(
            message, SummaryTranscriptEntry
        ):
            session_id = getattr(message, "sessionId", "")
            if not session_id:
                continue

            if session_id not in sessions:
                sessions[session_id] = {
                    "id": session_id,
                    "summary": session_summaries.get(session_id),
                    "first_timestamp": getattr(message, "timestamp", ""),
                    "last_timestamp": getattr(message, "timestamp", ""),
                    "message_count": 0,
                    "first_user_message": "",
                }

            sessions[session_id]["message_count"] += 1
            current_timestamp = getattr(message, "timestamp", "")
            if current_timestamp:
                sessions[session_id]["last_timestamp"] = current_timestamp

            # Get first user message for preview (skip system messages)
            if (
                isinstance(message, UserTranscriptEntry)
                and not sessions[session_id]["first_user_message"]
                and hasattr(message, "message")
            ):
                first_user_content = extract_text_content(message.message.content)
                if should_use_as_session_starter(first_user_content):
                    sessions[session_id]["first_user_message"] = create_session_preview(
                        first_user_content
                    )

    # Convert to list format with formatted timestamps
    session_list: List[Dict[str, Any]] = []
    for session_data in sessions.values():
        from .template_data import format_timestamp

        first_ts = session_data["first_timestamp"]
        last_ts = session_data["last_timestamp"]
        timestamp_range = ""
        if first_ts and last_ts:
            if first_ts == last_ts:
                timestamp_range = format_timestamp(first_ts)
            else:
                timestamp_range = (
                    f"{format_timestamp(first_ts)} - {format_timestamp(last_ts)}"
                )
        elif first_ts:
            timestamp_range = format_timestamp(first_ts)

        session_dict: Dict[str, Any] = {
            "id": session_data["id"],
            "summary": session_data["summary"],
            "timestamp_range": timestamp_range,
            "message_count": session_data["message_count"],
            "first_user_message": session_data["first_user_message"]
            if session_data["first_user_message"] != ""
            else "[No user message found in session.]",
        }
        session_list.append(session_dict)

    # Sort by first timestamp (ascending order, oldest first like transcript page)
    return sorted(
        session_list, key=lambda s: s.get("timestamp_range", ""), reverse=False
    )


def _generate_individual_session_files(
    messages: List[TranscriptEntry],
    output_dir: Path,
    from_date: Optional[str] = None,
    to_date: Optional[str] = None,
    cache_manager: Optional["CacheManager"] = None,
) -> None:
    """Generate individual HTML files for each session."""
    # Find all unique session IDs
    session_ids: set[str] = set()
    for message in messages:
        if hasattr(message, "sessionId"):
            session_id: str = getattr(message, "sessionId")
            if session_id:
                session_ids.add(session_id)

    # Get session data from cache for better titles
    session_data: Dict[str, Any] = {}
    working_directories = None
    if cache_manager is not None:
        project_cache = cache_manager.get_cached_project_data()
        if project_cache:
            session_data = {s.session_id: s for s in project_cache.sessions.values()}
            # Get working directories for project title
            if project_cache.working_directories:
                working_directories = project_cache.working_directories

    project_title = get_project_display_name(output_dir.name, working_directories)

    # Generate HTML file for each session
    for session_id in session_ids:
        # Create session-specific title using cache data if available
        if session_id in session_data:
            session_cache = session_data[session_id]
            if session_cache.summary:
                session_title = f"{project_title}: {session_cache.summary}"
            else:
                # Fall back to first user message preview
                preview = session_cache.first_user_message
                if preview and len(preview) > 50:
                    preview = preview[:50] + "..."
                session_title = (
                    f"{project_title}: {preview}"
                    if preview
                    else f"{project_title}: Session {session_id[:8]}"
                )
        else:
            # Fall back to basic session title
            session_title = f"{project_title}: Session {session_id[:8]}"

        # Add date range if specified
        if from_date or to_date:
            date_range_parts: List[str] = []
            if from_date:
                date_range_parts.append(f"from {from_date}")
            if to_date:
                date_range_parts.append(f"to {to_date}")
            date_range_str = " ".join(date_range_parts)
            session_title += f" ({date_range_str})"

        # Check if session file needs regeneration
        session_file_path = output_dir / f"session-{session_id}.html"

        # Only regenerate if outdated, doesn't exist, or date filtering is active
        should_regenerate_session = (
            is_html_outdated(session_file_path)
            or from_date is not None
            or to_date is not None
            or not session_file_path.exists()
        )

        if should_regenerate_session:
            # Generate session HTML
            session_html = generate_session_html(messages, session_id, cache_manager)
            # Write session file
            session_file_path.write_text(session_html, encoding="utf-8")
        else:
            print(
                f"Session file {session_file_path.name} is current, skipping regeneration"
            )


def process_projects_hierarchy(
    projects_path: Path,
    from_date: Optional[str] = None,
    to_date: Optional[str] = None,
    use_cache: bool = True,
) -> Path:
    """Process the entire ~/.claude/projects/ hierarchy and create linked HTML files."""
    if not projects_path.exists():
        raise FileNotFoundError(f"Projects path not found: {projects_path}")

    # Find all project directories (those with JSONL files)
    project_dirs: List[Path] = []
    for child in projects_path.iterdir():
        if child.is_dir() and list(child.glob("*.jsonl")):
            project_dirs.append(child)

    if not project_dirs:
        raise FileNotFoundError(
            f"No project directories with JSONL files found in {projects_path}"
        )

    # Get library version for cache management
    library_version = get_library_version()

    # Process each project directory
    project_summaries: List[Dict[str, Any]] = []
    for project_dir in sorted(project_dirs):
        try:
            # Initialize cache manager for this project
            cache_manager = None
            if use_cache:
                try:
                    cache_manager = CacheManager(project_dir, library_version)
                except Exception as e:
                    print(f"Warning: Failed to initialize cache for {project_dir}: {e}")

            # Phase 1: Ensure cache is fresh and populated
            ensure_fresh_cache(project_dir, cache_manager, from_date, to_date)

            # Phase 2: Generate HTML for this project (including individual session files)
            output_path = convert_jsonl_to_html(
                project_dir, None, from_date, to_date, True, use_cache
            )

            # Get project info for index - use cached data if available
            jsonl_files = list(project_dir.glob("*.jsonl"))
            jsonl_count = len(jsonl_files)
            last_modified: float = (
                max(f.stat().st_mtime for f in jsonl_files) if jsonl_files else 0.0
            )

            # Phase 3: Use fresh cached data for index aggregation
            if cache_manager is not None:
                cached_project_data = cache_manager.get_cached_project_data()
                if cached_project_data is not None:
                    # Use cached aggregation data
                    project_summaries.append(
                        {
                            "name": project_dir.name,
                            "path": project_dir,
                            "html_file": f"{project_dir.name}/{output_path.name}",
                            "jsonl_count": jsonl_count,
                            "message_count": cached_project_data.total_message_count,
                            "last_modified": last_modified,
                            "total_input_tokens": cached_project_data.total_input_tokens,
                            "total_output_tokens": cached_project_data.total_output_tokens,
                            "total_cache_creation_tokens": cached_project_data.total_cache_creation_tokens,
                            "total_cache_read_tokens": cached_project_data.total_cache_read_tokens,
                            "latest_timestamp": cached_project_data.latest_timestamp,
                            "earliest_timestamp": cached_project_data.earliest_timestamp,
                            "working_directories": cached_project_data.working_directories,
                            "sessions": [
                                {
                                    "id": session_data.session_id,
                                    "summary": session_data.summary,
                                    "timestamp_range": _format_session_timestamp_range(
                                        session_data.first_timestamp,
                                        session_data.last_timestamp,
                                    ),
                                    "message_count": session_data.message_count,
                                    "first_user_message": session_data.first_user_message
                                    or "[No user message found in session.]",
                                }
                                for session_data in cached_project_data.sessions.values()
                            ],
                        }
                    )
                    continue

            # Fallback for when cache is not available (should be rare)
            print(
                f"Warning: No cached data available for {project_dir.name}, using fallback processing"
            )
            messages = load_directory_transcripts(
                project_dir, cache_manager, from_date, to_date
            )
            if from_date or to_date:
                messages = filter_messages_by_date(messages, from_date, to_date)

            # Calculate token usage aggregation and find first/last interaction timestamps
            total_input_tokens = 0
            total_output_tokens = 0
            total_cache_creation_tokens = 0
            total_cache_read_tokens = 0
            latest_timestamp = ""
            earliest_timestamp = ""

            # Track requestIds to avoid double-counting tokens
            seen_request_ids: set[str] = set()

            # Collect session data for this project
            sessions_data = _collect_project_sessions(messages)

            for message in messages:
                # Track latest and earliest timestamps across all messages
                if hasattr(message, "timestamp"):
                    message_timestamp = getattr(message, "timestamp", "")
                    if message_timestamp:
                        # Track latest timestamp
                        if not latest_timestamp or message_timestamp > latest_timestamp:
                            latest_timestamp = message_timestamp

                        # Track earliest timestamp
                        if (
                            not earliest_timestamp
                            or message_timestamp < earliest_timestamp
                        ):
                            earliest_timestamp = message_timestamp

                # Calculate token usage for assistant messages
                if message.type == "assistant" and hasattr(message, "message"):
                    assistant_message = getattr(message, "message")
                    request_id = getattr(message, "requestId", None)

                    if (
                        hasattr(assistant_message, "usage")
                        and assistant_message.usage
                        and request_id
                        and request_id not in seen_request_ids
                    ):
                        # Mark requestId as seen to avoid double-counting
                        seen_request_ids.add(request_id)

                        usage = assistant_message.usage
                        totals = {
                            "input": total_input_tokens,
                            "output": total_output_tokens,
                            "cache_creation": total_cache_creation_tokens,
                            "cache_read": total_cache_read_tokens,
                        }
                        aggregate_token_usage(usage, totals)
                        total_input_tokens = totals["input"]
                        total_output_tokens = totals["output"]
                        total_cache_creation_tokens = totals["cache_creation"]
                        total_cache_read_tokens = totals["cache_read"]

            project_summaries.append(
                {
                    "name": project_dir.name,
                    "path": project_dir,
                    "html_file": f"{project_dir.name}/{output_path.name}",
                    "jsonl_count": jsonl_count,
                    "message_count": len(messages),
                    "last_modified": last_modified,
                    "total_input_tokens": total_input_tokens,
                    "total_output_tokens": total_output_tokens,
                    "total_cache_creation_tokens": total_cache_creation_tokens,
                    "total_cache_read_tokens": total_cache_read_tokens,
                    "latest_timestamp": latest_timestamp,
                    "earliest_timestamp": earliest_timestamp,
                    "working_directories": extract_working_directories(messages),
                    "sessions": sessions_data,
                }
            )
        except Exception as e:
            print(
                f"Warning: Failed to process {project_dir}: {e}\n"
                f"Previous (in alphabetical order) file before error: {project_summaries[-1]}"
                f"\n{traceback.format_exc()}"
            )
            continue

    # Calculate total statistics from project summaries
    total_stats: Dict[str, Any] = {
        "total_messages": sum(p.get("message_count", 0) for p in project_summaries),
        "user_messages": sum(p.get("user_messages", 0) for p in project_summaries),
        "assistant_messages": sum(
            p.get("assistant_messages", 0) for p in project_summaries
        ),
        "system_messages": sum(p.get("system_messages", 0) for p in project_summaries),
        "tool_uses": sum(p.get("tool_uses", 0) for p in project_summaries),
        "tool_results": sum(p.get("tool_results", 0) for p in project_summaries),
        "total_sessions": sum(p.get("session_count", 0) for p in project_summaries),
        "total_input_tokens": sum(
            p.get("total_input_tokens", 0) for p in project_summaries
        ),
        "total_output_tokens": sum(
            p.get("total_output_tokens", 0) for p in project_summaries
        ),
        "total_cache_creation_tokens": sum(
            p.get("total_cache_creation_tokens", 0) for p in project_summaries
        ),
        "total_cache_read_tokens": sum(
            p.get("total_cache_read_tokens", 0) for p in project_summaries
        ),
    }

    # Calculate date range if needed
    if from_date or to_date:
        date_parts: List[str] = []
        if from_date:
            date_parts.append(f"from {from_date}")
        if to_date:
            date_parts.append(f"to {to_date}")
        total_stats["date_range"] = " ".join(date_parts)
    else:
        # Calculate from project timestamps
        all_timestamps: List[str] = []
        for p in project_summaries:
            if p.get("earliest_timestamp"):
                all_timestamps.append(p["earliest_timestamp"])
            if p.get("latest_timestamp"):
                all_timestamps.append(p["latest_timestamp"])
        if all_timestamps:
            total_stats["date_range"] = f"{min(all_timestamps)} - {max(all_timestamps)}"
        else:
            total_stats["date_range"] = None

    # Generate index HTML (always regenerate if outdated)
    index_path = projects_path / "index.html"
    if is_html_outdated(index_path) or from_date or to_date:
        # Get cache manager if we're using one
        cache_manager_for_index = None
        if use_cache and project_summaries:
            # Use the cache manager from any project (they all share the same structure)
            first_project_path = project_summaries[0]["path"]
            cache_manager_for_index = CacheManager(
                first_project_path, get_library_version()
            )

        index_html = generate_projects_index_html(
            project_summaries, total_stats, cache_manager_for_index
        )
        index_path.write_text(index_html, encoding="utf-8")
    else:
        print("Index HTML is current, skipping regeneration")

    return index_path

